import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import { faGoogle } from '@fortawesome/free-brands-svg-icons';

import React from 'react';

const Google = () => <FontAwesomeIcon icon={faGoogle} />;

export { Google };
